script: |
  super -f tsv -I q5888.sql | sort > q5888.out

vector: true

inputs:
  - name: q5888.sql
    data: |
      SELECT DISTINCT ( col1 ) * + col1 + col1 AS col0 FROM tab2 WHERE NOT col2 BETWEEN + col1 AND NULL AND NOT - 97 IN ( + - col1 / + - col0 );
  - name: tab2

outputs:
  - name: q5888.out
    data: |
      2652
      4556
      6006
